import React from "react";
import {Menu} from "antd";
import {Link} from "react-router-dom";

import CustomScrollbars from "util/CustomScrollbars";
import SidebarLogo from "./SidebarLogo";
import UserProfile from "./UserProfile";
import AppsNavigation from "./AppsNavigation";
import {
  NAV_STYLE_NO_HEADER_EXPANDED_SIDEBAR,
  NAV_STYLE_NO_HEADER_MINI_SIDEBAR,
  THEME_TYPE_LITE
} from "../../constants/ThemeSetting";
import IntlMessages from "../../util/IntlMessages";
import {useSelector} from "react-redux";

const SidebarContent = ({sidebarCollapsed, setSidebarCollapsed}) => {
  const {navStyle, themeType} = useSelector(({settings}) => settings);
  const pathname = useSelector(({common}) => common.pathname);

  const getNoHeaderClass = (navStyle) => {
    if (navStyle === NAV_STYLE_NO_HEADER_MINI_SIDEBAR || navStyle === NAV_STYLE_NO_HEADER_EXPANDED_SIDEBAR) {
      return "gx-no-header-notifications";
    }
    return "";
  };

  const selectedKeys = pathname.substr(1);
  const defaultOpenKeys = selectedKeys.split('/')[1];

  return (
    <>
      <SidebarLogo sidebarCollapsed={sidebarCollapsed} setSidebarCollapsed={setSidebarCollapsed}/>
      <div className="gx-sidebar-content">
        <div className={`gx-sidebar-notifications ${getNoHeaderClass(navStyle)}`}>
          <UserProfile/>
          <AppsNavigation/>
        </div>
        <CustomScrollbars className="gx-layout-sider-scrollbar">
          <Menu
            defaultOpenKeys={[defaultOpenKeys]}
            selectedKeys={[selectedKeys]}
            theme={themeType === THEME_TYPE_LITE ? 'lite' : 'dark'}
            mode="inline">

            <Menu.Item key="dashboard">
              <Link to="/dashboard"><i className="icon icon-widgets"/>
                <span><IntlMessages id="sidebar.samplePage"/></span>
              </Link>
            </Menu.Item>

            <Menu.Item key="wajib-pajak">
              <Link to="/wajib-pajak"><i className="icon icon-widgets"/>
                <span><IntlMessages id="sidebar.wajibPajak"/></span>
              </Link>
            </Menu.Item>
            <li class="dt-side-nav__item open">
            <a href="javascript:void(0)" class="dt-side-nav__link dt-side-nav__arrow" title="Dashboard">
              <i class="icon icon-dashboard icon-fw icon-xl"></i> <span class="dt-side-nav__text">Dashboard</span> </a>

            {/* <!-- Sub-menu --> */}
            <ul class="dt-side-nav__sub-menu">
              <li class="dt-side-nav__item">
                <a href="page-blank.html?menu=dashboard-crypto" class="dt-side-nav__link" title="Crypto"> <i
                      class="icon icon-crypto icon-fw icon-sm"></i>
                  <span class="dt-side-nav__text">Crypto</span> </a>
              </li>
              <li class="dt-side-nav__item">
                <a href="index.html" class="dt-side-nav__link" title="CRM"> <i class="icon icon-crm icon-fw icon-sm"></i>
                  <span class="dt-side-nav__text">Crm</span> </a>
              </li>

              <li class="dt-side-nav__item">
                <a href="page-blank.html?menu=dashboard-listing" class="dt-side-nav__link" title="Listing">
                  <i class="icon icon-listing-dbrd icon-fw icon-sm"></i> <span class="dt-side-nav__text">Listing</span> </a>
              </li>

            </ul>
            {/* <!-- /sub-menu --> */}

          </li>
          <li class="dt-side-nav__item">
            <a href="page-blank.html?menu=widget" class="dt-side-nav__link" title="Widgets"> <i
                  class="icon icon-widgets icon-fw icon-xl"></i>
              <span class="dt-side-nav__text">Widgets</span> </a>
          </li>
          </Menu>
        </CustomScrollbars>
      </div>
    </>
  );
};

export default React.memo(SidebarContent);
